import React from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Box,
  Container,
  Typography,
  Button,
  Grid,
  Card,
  CardMedia,
  CardContent,
  CardActions,
} from '@mui/material';

const defaultImage = 'https://images.unsplash.com/photo-1462331940025-496dfbfc7564?auto=format&fit=crop&w=2048&q=80';
const galaxyImage = 'https://images.unsplash.com/photo-1506703719100-a0f3a48c0f86?auto=format&fit=crop&w=2048&q=80';

const featuredProducts = [
  {
    id: 1,
    name: 'Smart Telescope Kit',
    description: 'App-controlled telescope with automatic star tracking and imaging',
    image: 'https://images.unsplash.com/photo-1516339901601-2e1b62dc0c45?auto=format&fit=crop&w=500',
    price: '₹24,999',
  },
  {
    id: 2,
    name: 'Genuine Meteorite Fragment',
    description: 'Authenticated meteorite fragment with display case and certificate',
    image: 'https://images.unsplash.com/photo-1581822261290-991b38693d1b?auto=format&fit=crop&w=500',
    price: '₹4,999',
  },
  {
    id: 3,
    name: 'Galaxy Projector Lamp',
    description: 'LED star projector with nebula effects and bluetooth speaker',
    image: 'https://images.unsplash.com/photo-1534447677768-be436bb09401?auto=format&fit=crop&w=500',
    price: '₹2,499',
  },
];

const Home = () => {
  const navigate = useNavigate();

  return (
    <>
      <Box
        sx={{
          minHeight: '90vh',
          display: 'flex',
          alignItems: 'center',
          background: `linear-gradient(rgba(0,0,0,0.7), rgba(0,0,0,0.7)), url(${galaxyImage})`,
          backgroundSize: 'cover',
          backgroundPosition: 'center',
          backgroundAttachment: 'fixed',
          position: 'relative',
        }}
      >
        <Container maxWidth="lg" sx={{ position: 'relative', zIndex: 1 }}>
          <Typography
            variant="h1"
            sx={{
              fontSize: { xs: '2.5rem', sm: '3.5rem', md: '4.5rem' },
              fontWeight: 700,
              mb: 4,
              textShadow: '2px 2px 4px rgba(0,0,0,0.5)',
              background: 'linear-gradient(45deg, #7c4dff, #1a237e)',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent',
            }}
          >
            Explore the Cosmos
          </Typography>
          <Typography
            variant="h5"
            sx={{
              mb: 4,
              maxWidth: '600px',
              textShadow: '1px 1px 2px rgba(0,0,0,0.5)',
              color: '#fff',
              lineHeight: 1.6,
            }}
          >
            Discover our collection of astronomical equipment, educational toys, and space-themed products. 
            Start your journey to the stars today.
          </Typography>
          <Button
            variant="contained"
            size="large"
            onClick={() => navigate('/products')}
            sx={{
              background: 'rgba(124, 77, 255, 0.8)',
              '&:hover': { 
                background: 'rgba(124, 77, 255, 1)',
                transform: 'translateY(-2px)',
              },
              backdropFilter: 'blur(4px)',
              transition: 'all 0.3s ease-in-out',
              px: 4,
              py: 1.5,
            }}
          >
            Shop Now
          </Button>
        </Container>
      </Box>

      <Container maxWidth="lg" sx={{ py: 8 }}>
        <Typography 
          variant="h2" 
          sx={{ 
            mb: 6, 
            textAlign: 'center',
            background: 'linear-gradient(45deg, #7c4dff, #1a237e)',
            WebkitBackgroundClip: 'text',
            WebkitTextFillColor: 'transparent',
          }}
        >
          Featured Products
        </Typography>
        <Grid container spacing={4}>
          {featuredProducts.map((product) => (
            <Grid item key={product.id} xs={12} sm={6} md={4}>
              <Card
                sx={{
                  height: '100%',
                  display: 'flex',
                  flexDirection: 'column',
                  background: 'rgba(255,255,255,0.05)',
                  backdropFilter: 'blur(10px)',
                  border: '1px solid rgba(255,255,255,0.1)',
                  transition: 'all 0.3s ease-in-out',
                  '&:hover': {
                    transform: 'translateY(-8px)',
                    boxShadow: '0 12px 20px rgba(0,0,0,0.2)',
                    border: '1px solid rgba(124, 77, 255, 0.3)',
                  },
                }}
              >
                <CardMedia
                  component="img"
                  height="240"
                  image={product.image}
                  alt={product.name}
                  sx={{ 
                    objectFit: 'cover',
                    borderBottom: '1px solid rgba(255,255,255,0.1)',
                  }}
                />
                <CardContent sx={{ flexGrow: 1, p: 3 }}>
                  <Typography 
                    gutterBottom 
                    variant="h5" 
                    component="h2"
                    sx={{
                      fontWeight: 600,
                      color: '#fff',
                    }}
                  >
                    {product.name}
                  </Typography>
                  <Typography 
                    sx={{
                      color: 'rgba(255,255,255,0.7)',
                      mb: 2,
                    }}
                  >
                    {product.description}
                  </Typography>
                  <Typography 
                    variant="h6" 
                    sx={{ 
                      color: '#7c4dff',
                      fontWeight: 600,
                    }}
                  >
                    {product.price}
                  </Typography>
                </CardContent>
                <CardActions sx={{ p: 2, pt: 0 }}>
                  <Button 
                    size="large" 
                    sx={{
                      color: '#7c4dff',
                      '&:hover': {
                        background: 'rgba(124, 77, 255, 0.1)',
                      },
                    }}
                    onClick={() => navigate('/products')}
                  >
                    Learn More
                  </Button>
                  <Button
                    variant="contained"
                    size="large"
                    sx={{
                      ml: 'auto',
                      background: 'rgba(124, 77, 255, 0.8)',
                      '&:hover': {
                        background: 'rgba(124, 77, 255, 1)',
                      },
                    }}
                  >
                    Add to Cart
                  </Button>
                </CardActions>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>
    </>
  );
};

export default Home;
